<?php	require_once ("\../lib\\common\\dao\\VO.class.php");	class Modulemenucontrol extends VO {		private $moduleVO;		private $menuVO;		private $moduleid;		private $menuid;		public function setModule($moduleVO){			$this->moduleVO=$moduleVO;		}		public function getModule(){			return $this->moduleVO;		}		public function setMenu($menuVO){			$this->menuVO=$menuVO;		}		public function getMenu(){			return $this->menuVO;		}		public function setModuleid($moduleid){			$this->moduleid=$moduleid;		}		public function getModuleid(){			return $this->moduleid;		}		public function setMenuid($menuid){			$this->menuid=$menuid;		}		public function getMenuid(){			return $this->menuid;		}		public function __toString(){			return "moduleid=".$this->moduleid."(".$this->moduleVO.")".", menuid=".$this->menuid."(".$this->menuVO.")";		}	}?>